description:
Lego DREAMZzz Kum Adam’ın Kulesi 71477
9 yaş ve üzeri çocuklar, bu LEGO® DREAMZzz™ kale oyuncağıyla (71477) Kum Adam'ın Kulesi’ni keşfetsin. Heyecan verici TV dizisine dayalı bu yapım setinde çocuklar, kahraman figürlerinin Kum Adam’ın sihirli evini kötü Never Cadısı ve yardımcısı Sneak’e karşı korumaya yardım edebilir! Bu harika oyuncak, çocuklara 2 yapım seçeneği sunarak hayal güçlerini kullanmaya teşvik eder. Görkemli bir kaleye ya da zarif bir kuleye dönüştürmeyi seçebilirler. Kale modunda modelin bir kum saati topu, kule modunda ise dönen bir tepesi bulunur. Her iki yapım seçeneği de silah rafı, iksir istasyonu ve sihirli kitap gibi heyecan verici aksesuarların yanı sıra duruşu ayarlanabilen bir oyuncak kuş ve örümcek gibi fantastik hayvan figürleri içerir. Izzie, Mateo, Logan, Kum Adam, kötü Never Cadısı ve Sneak figürüyle hayat bulan kale oyun setinde çocuklar düşlerindeki kuleyi inşa edebilirler.;

Çocuklar için kale oyuncağı – 9 yaş ve üzeri kız ve erkek çocuklar, LEGO® DREAMZzz™ Kum Adam'ın Kulesi yapım oyuncağıyla hayal güçlerini çalıştırır;
Oynamanın 2 yolu – Yaratıcı çocuklar, kale oyun setini görkemli bir kaleye ya da zarif bir kuleye dönüştürmeyi seçebilir;
5 detaylı LEGO® DREAMZzz™ minifigürü – Izzie, Mateo, Logan, Kum Adam ve kötü Never cadısı, ayrıca yardımcısı Sneak figürü;
Çocuklar için hediye fikri – Bu harika oyuncak, 9 yaş ve üzeri erkek ve kız çocuklara ödül olarak verilebilir;
Harika hayvan oyuncakları – Yapım setinde duruşu ayarlanabilen oyuncak bir örümcek ile oyuncak bir kuş bulunur;
Sezgisel yapım – Setin hikayeye dayalı yapım talimatları, ayrıca LEGO® Builder uygulamasında da dijital olarak bulunur;
Boyutlar – Bu 723 parçalı setin kule modunda yüksekliği 47 cm, genişliği 14 cm, derinliği 25 cm’dir;
